description:
Re-consultation following the submission a 'revised Community Facilities Statement' on 9 September 2021 - further to this it is highlighted that changes have also been made on 1 June 2021 and 9 September 2021 in respect of the elevational treatment, Fire Safety Statement, revised Acoustic Assessment, updated Flood Risk Assessment information and sustainability measures;

Demolition of the existing buildings. Erection of buildings of up to 10 storeys accommodating 78 residential units (Use Class C3) alongside 541 sqm (GEA) retail floorspace (Use Class E) and 194 sqm (GEA) community use floorspace (Use Class E / F.1 / F.2) at ground floor. Associated car and cycle parking. Associated landscaping works. New vehicular access from Earlham Grove and other associated works.
(Application site is located within Forest Gate Town Centre Conservation Area, adjoining Woodgrange Estate Conservation Area and affects the setting of a Grade II Listed Sculpture called "The Preacher").
